// src/Сomponents/Header.js
import React from "react";
import { Link } from "react-router-dom";
import logo from '../../resources/mainpage/logo.png'

const Header = ({ onLogin, isLoggedIn }) => {
  return (
    <div className="headerContainer container">
      <div className="row">
        <div className={`col-md-6 logoStart`}>
          <div className="logo">
            <img src={logo} alt="logo" />
          </div>
        </div>
        <div className={`col-md-6 buttonEnd`}>
          {isLoggedIn ? (
            <div>
              <Link to="/" className="btn">
                PDF
              </Link>
              <Link to="/unloading" className="btn">
                Unloading
              </Link>
              <Link to="/admin" className="btn">
                Admin
              </Link>
            </div>
          ) : (
            <button className="login" onClick={onLogin}>
              LOG IN
            </button>
          )}
        </div>
      </div>
    </div>
  );
};
export default Header;
